package com.itwill.dto;

public class Jumpo {
	private Member jMember;
	private Restaurant jRestaurant;
	private Book jBook;
	private Review jReview;
	
	
	private String stsValue;
	private String stsText;
	private int bookNo;
	
	private int iValue;
	
	public Jumpo() {
		// TODO Auto-generated constructor stub
	}

	public Member getjMember() {
		return jMember;
	}

	public void setjMember(Member jMember) {
		this.jMember = jMember;
	}

	public Restaurant getjRestaurant() {
		return jRestaurant;
	}

	public void setjRestaurant(Restaurant jRestaurant) {
		this.jRestaurant = jRestaurant;
	}

	public Book getjBook() {
		return jBook;
	}

	public void setjBook(Book jBook) {
		this.jBook = jBook;
	}

	public Review getjReview() {
		return jReview;
	}

	public void setjReview(Review jReview) {
		this.jReview = jReview;
	}

	
	public String getStsValue() {
		return stsValue;
	}

	public void setStsValue(String stsValue) {
		this.stsValue = stsValue;
	}

	public String getStsText() {
		return stsText;
	}

	public void setStsText(String stsText) {
		this.stsText = stsText;
	}

	public int getBookNo() {
		return bookNo;
	}

	public void setBookNo(int bookNo) {
		this.bookNo = bookNo;
	}

	public int getiValue() {
		return iValue;
	}

	public void setiValue(int iValue) {
		this.iValue = iValue;
	}

	

	

	

	
	
}
	
	